import React from 'react'
import { useState } from 'react';
import axios from 'axios';
// import { NavLink, useHistory, useLocation } from 'react-router-dom';
import {Navbar, Nav, Container,Row, Col, Modal,Form, Button} from 'react-bootstrap';
import { LoginData, RegistrationData } from '../types/types';

const CustomNavbar = () => {
  const [userLogin, setUserLogin] = useState<LoginData>({
    email: '',
    password: '',
    user_type: 1
  })

    const [userType, setUserType] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const LogIn = async (e) => {
        e.preventDefault()


        const res = await fetch('/api/login', {
            method: "POST",
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                email, password
            })
        });

        const data = await res.json();



        if (res.status === 201) {

            window.alert("login Successful")
            localStorage.setItem('token', data.token)
            window.location.reload();
            history.push('/');
            window.location.reload();
        } else {
            window.alert("Invalid Credentials")
        }

    }






    const [login, setLogin] = useState(false);
    const [register, setRegister] = useState(false);

    const loginClose = () => setLogin(false);
    const registerClose = () => setRegister(false);
    const handleLogin = () => setLogin(true);
    const handleRegister = () => setRegister(true);

  return (
    <>
    <Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">Rentify</Navbar.Brand>
          <Nav className="me-2">
          <Button className='me-1' variant="outline-secondary" onClick={handleRegister}>
            Register
          </Button>
          <Button className='ms-1' variant="outline-secondary" onClick={handleLogin}>
            Login
          </Button>
          </Nav>
        </Container>
      </Navbar>

      <Modal
        show={login}
        onHide={loginClose}
        backdrop="static"
        keyboard={false}
      >
      <Modal.Header closeButton>
          <Modal.Title>Log in</Modal.Title>
        </Modal.Header>
        <Modal.Body>
        <Form>
        <Form.Group as={Row} className="mb-3" controlId="email">
        <Form.Label column sm={3}>
          Email
        </Form.Label>
        <Col sm={9}>
          <Form.Control type="email" name='email' id="email" value={userLogin.email}
          onChange={evt => {
            sethandleLogin("email", evt.target.value);
          }}
          placeholder="Email" />
        </Col>
      </Form.Group>
      <Form.Group as={Row} className="mb-3" controlId="password">
        <Form.Label column sm={3}>
          Password
        </Form.Label>
        <Col sm={9}>
          <Form.Control type="password" id="password" name='password' 
          value={userLogin.password} 
          onChange={evt => {
            sethandleLogin("password", evt.target.value);
          }}
          placeholder="Password" />
        </Col>
      </Form.Group>
          <fieldset>
        <Form.Group as={Row} className="mb-3">
          <Form.Label as="legend" column sm={3}>
            User Type
          </Form.Label>
          <Col sm={9}>
            <Form.Check
              type="radio"
              value={userLogin.user_type}
              label="Buyer"
              name="user_type"
              id="buyer"
              checked={userType === 1}
              onChange={(e) => setUserType(e.target.value)}
            />
            <Form.Check
              type="radio"
              value={userLogin.user_type}
              label="Seller"
              name="user_type"
              id="seller"
              checked={userType === 2}
              onChange={(e) => setUserType(e.target.value)}
            />
          </Col>
        </Form.Group>
      </fieldset>
      <Form.Group as={Row} className="mb-3">
        <Col sm={{ span: 8, offset: 4 }}>
          <Button type="submit" className='btn btn-primary' id='login' name='login' onClick={LogIn}>Log in</Button>
        </Col>
      </Form.Group>
        </Form>
        </Modal.Body>
        
      </Modal>
    </>
  )
}

export default CustomNavbar
